Vlaanderen
Komedie
95 minuten

geregisseerd door Patrick Lebon
met Gaston Berghmans, Leo Martin en Janine Bischops

Gaston en Leo worden als gemotoriseerde agenten op de weerloze stad losgelaten. Waar zij verschijnen, is de paniek nooit ver uit de buurt. Maar ook op het politiebureau zaaien ze vertwijfeling. Wanneer ze hun zoveelste motor in de prak rijden, is voor de hoofdcommissaris de maat vol: ze moeten als gewone wijkagenten weer de straat op. Te voet.

